INSERT INTO `lexik_email_translation` (`id`, `email_id`, `lang`, `subject`, `body`, `body_text`, `from_address`, `from_name`, `created_at`, `updated_at`) VALUES
(1, 1, 'es', '[Taskul.net] Solicitud de contacto', 'Ha recibido una solicitud de contacto enviada por: {{ from.firstname }} {{ from.lastname }} con el siguiente mensaje:\r\n\r\n<blockquote>\r\n{{ message|raw }}\r\n</blockquote>\r\n\r\nPara activarla <a href="{{ url(''frequest_register'',{''hash'': hash}) }}">pulse aqui.</a>', 'Ha recibido una solicitud de contacto enviada por: {{ from.firstname }} {{ from.lastname }} con el siguiente mensaje:\r\n\r\n{{ message|striptags }}\r\n\r\nPara activarla siga el siguiente enlace: url(''frequest_register'',{''hash'': hash}) }}.', NULL, 'Taskul Net', '2013-06-26 19:18:04', '2013-07-01 19:09:52'),
(2, 2, 'es', '[Taskul.net] Tiene notificaciones pendientes', 'Tiene notificaciones pendientes en su cuenta acceda <a href="{{ url(''homepage'') }}">haciendo clíck aquí</a> para revisarlas.', 'Tiene notificaciones pendientes en su cuenta acceda siguiendo este enlace: {{ url(''homepage'') }} para revisarlas.', NULL, 'Taskul Net', '2013-07-01 18:58:38', '2013-07-01 19:15:03');
