(143, 3, 'Dar estilo a comentarios', 'Nos quedamos poniendo los textarea en los comentarios<br />', NULL, 'done', '2013-05-29 22:41:22', '2013-06-18 10:30:31', 100),
(144, 3, 'Los tags se crean repetidos', 'Los tags se crean repetidos debería de crearse únicamente uno por usuario<br /><br />Revisar si esto es así por alog (creo que se crea por entidad y usuario)<br /><br />No se crean repetidos lo que pasa es que al obtenerlos si estan repetidos (pej el mismo tag esta para varias entidades) se modifica el sql para que devuelva los únicos.<br />', NULL, 'done', '2013-05-29 22:45:32', '2013-06-12 21:57:56', 100),
(145, 3, 'Los comentarios se repiten', 'También ocurre lo mismo con los votos<br /><div><br /></div><div><br /></div><div>---</div><div>Acabado se modifica el js</div>', NULL, 'done', '2013-05-29 22:56:22', '2013-07-07 20:15:59', 100),
(146, 3, 'Notificaciones de comentarios', 'Las notificaciones de comentarios (arriba) no se ven bien<br />', NULL, 'done', '2013-05-30 21:23:13', '2013-06-18 18:59:35', 100),
(147, 3, 'Estado de las tareas', 'Al crear una tarea se pone por defecto a 0 si no se toca la barra de progreso<br />', NULL, 'done', '2013-05-30 21:24:09', '2013-06-18 10:46:00', 100),
(148, 3, 'Formulario de profile', 'Añadir todos los campos que faltan.<br /><br />Añadir lo de https://github.com/ornicar/GravatarBundle<br /><br />El view del show profile esta mal<br />', NULL, 'done', '2013-05-30 21:30:34', '2013-06-07 21:26:34', 100),
(149, 3, 'Notificaciones de tareas', 'Cuando se crean tareas de uno mismo no deberian de salir notificaciones<div><br /></div><div>Si las crea otro si</div><div><br /></div><div><strike>LAs notificaciones no se van al pulsar desde el enlace superir, </strike>lo que pasa es que no salen más de 10 notificaciones si hay más (en el contador superior). tambien pasa algo parecido en el contador de tareas en proceso pero en el listado.</div>', NULL, 'done', '2013-06-05 21:04:02', '2013-07-08 18:50:42', 100),
(150, 3, 'Titles en los ajaxy', 'Hay que poner titles en los ajaxy para que se muestre en la barra de titulo', NULL, 'inprogress', '2013-06-05 21:04:50', '2013-06-05 21:04:50', 50),
(151, 3, 'Errores en las notificaciones', 'El número de notificaciones es incorrecto (cuando hay mas de 8)<br />La notificacion no refleja que ha cambiado (pej si se ha modificado la tarea o si se ha terminado).<br /><br />El js de las notificaciones debe de ejecutarse cada vez que se cambia de pagina (limpiar las variables para que se regenere)<br /><br />', NULL, 'done', '2013-06-16 21:50:05', '2013-06-18 10:43:38', 100),
(152, 3, 'Miembros de las tareas', 'Hay que quitar como miembro en las tareas al propietarios<br />', NULL, 'done', '2013-06-18 09:43:11', '2013-06-18 10:50:39', 100),
(153, 3, 'Prueba de tarea por defecto', 'Aqui vamos se debe poner en 0<br />', NULL, 'done', '2013-06-18 10:44:28', '2013-06-18 10:52:33', 100),
(154, 3, 'Mejoras en la zona de las tareas', '<ul><li>Incluir el listado de comentarios en la edición<br /></li><li>Incluir todos los datos en la visualización (ficheros, miembros ...)</li><li>El porcentaje hacerlo visual<br /></li></ul>', NULL, 'inprogress', '2013-06-18 19:01:28', '2013-07-08 18:48:52', 50),
(155, 3, 'Gestionar errores', 'Si una entidad de las siguientes no existe, redireccionar al listado (puede deberse a que se ha eliminado):<br /><br />1.- Tareas<br />2.- Solicitudes de amistad<div><br /></div><div>Esto pasa en las gestión de las notificaciones sobre todo<br /><br /></div>', NULL, 'done', '2013-06-18 19:27:01', '2013-07-07 20:13:35', 100),
(156, 3, 'Completar Dashboard', 'Incluir en la dashboard un enlace a lo más usado<br />Inlcuir el cosumo de espacio<br />', NULL, 'done', '2013-06-18 19:30:12', '2013-07-07 18:51:31', 100),
(157, 3, 'Invitaciones por email', 'Revisar el js de envio de invitaciones por email para que valide la cadena de email con los del jquery validate. Se pueden usar las siguientes funciones:<div><br /></div><div><div>validateEmail: function(value) {</div><div>    var regex = /^([\\w-\\.]+@([\\w-]+\\.)+[\\w-]{2,4})?$/;</div><div>    return (regex.test(value)) ? true : false;</div><div>}</div><div><br /></div><div>validateEmails: function(string) {</div><div>    var self = shareEmail;</div><div>    var result = string.replace(/\\s/g, "").split(/,|;/);</div><div><br /></div><div>    for(var i = 0;i &lt; result.length;i++) {</div><div>        if(!self.validateEmail(result[i])) {</div><div>            return false;</div><div>        }</div><div>    }</div><div><br /></div><div>    return true;</div><div>}</div></div>', NULL, 'inprogress', '2013-06-20 21:39:45', '2013-06-20 21:39:45', 50),
(160, 3, 'Errores en los modales', 'Los modales se cargan en los layout bases pero si la llamada es en ajax los modales no se cargan y mandan la solicitud al formulario equivocado.<div><br /></div><div>Revisar el ja que genera esto para ver si se puede optimizar.</div><div><br /></div><div>Esto pasa también con los js que se cargan en los layout, poner estos scripts en la vista final o en el private.</div>', NULL, 'done', '2013-07-01 18:25:56', '2013-07-07 20:12:04', 100),
(161, 3, 'Mensajes de aviso', 'Enviar menajes de aviso en las siguientes situaciones:<div><br /></div><div>1.- Notificaciones </div><div>2.- Solicitudes de amistad por email<br />3.- Cuando se agrega un contacto a una tarea<br /></div>', NULL, 'inprogress', '2013-07-01 18:43:47', '2013-07-07 20:34:53', 50),
(162, 3, 'Traducciones js i18next', 'El js de los mensajes siempre carga el US<br />', NULL, 'inprogress', '2013-07-05 19:40:42', '2013-07-07 18:51:31', 50),
(165, 3, 'La cuenta de notificaciones no se muestra donde debe', '<br />', NULL, 'done', '2013-07-06 11:46:37', '2013-07-07 20:14:48', 100),
(166, 3, 'Alta de nuevo miembro en una tarea', 'Cuando se añade un nuevo miembro a una tarea mandar una notificacion<br />', NULL, 'done', '2013-07-07 19:25:02', '2013-07-08 18:51:31', 100),
(169, 3, 'Crear calendario para las tareas', '<br />', NULL, 'todo', '2013-07-07 20:38:44', '2013-07-07 20:38:58', 1),
(170, 3, 'Añadir posibilidad de peridodos de tiempo en las tareas', '<br />', NULL, 'todo', '2013-07-07 20:46:18', '2013-07-07 20:47:57', 1),
(171, 3, 'Crear una gestión de ficheros', 'Posibilitar la elimiación de ficheros asociados al usuario.<br /><br />Tener en cuenta que se tienen que desvincular de la tarea.<br />', NULL, 'todo', '2013-07-07 20:57:59', '2013-07-07 20:57:59', 1),
(172, 3, 'Añadir posibilidad de tareas hijas', 'Añadir el campo padre a las tareas para poder gestionar subtareas.<br /><br />Los listados solo mostrarán las tareas de un nivel, y en los desplegables los nombres de las tareas hijas.<br /><br />Incluir botonnes de acceso.<br />', NULL, 'todo', '2013-07-07 21:00:48', '2013-07-07 21:00:48', 1),
(173, 3, 'Notificaciones: poner un acceso a ver más', '<br />', NULL, 'inprogress', '2013-07-07 21:08:20', '2013-07-07 21:08:20', 17),
(174, 8, 'Comentarios en mostrar tarea desplegables a traves de titulo', '<br />', NULL, 'inprogress', '2013-07-07 21:17:45', '2013-07-07 21:17:45', 50),
(175, 3, 'Notificaciones: al hacer click sobre ellas regenerar todo el sistema', '<br />', NULL, 'inprogress', '2013-07-07 21:22:14', '2013-07-07 21:22:14', 50);
